  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata record describes the ortho
  & lidar mapping of Sarasota County, FL. The mapping consists of lidar data collected
  using a Leica ALS-40 Lidar Sensor, contour generation, and production of natural
  color orthophotography with a 30-cm GSD using imagery collected with a Leica ADS-40
  Aerial Digital Camera. This topographic survey for Sarasota County covers 572 square
  miles and was acquired in two lift acquisitions. Lift 1 was on Feb 28 2004 and lift
  2 was on Mar 4, 2004. The original lidar had gaps in the coverage and the areas
  were flown on May 15, 2004. Lidar data acquired with 2 meter nominal post spacing.\",\n\t\"owner_org\":
